import { useState, useEffect } from 'react';

const Upload = () => {
    const [uploads, setUploads] = useState([]);

    useEffect(() => {
        fetch('http://localhost:5000/products')
            .then((response) => response.json())
            .then((data) => setUploads(data));
    }, []);

    return (
        <>
        </>
    );
};

export default Upload;
